// n8n Code node (JavaScript)
// Corrige códigos no formato: 1 letra + 5 dígitos (ex.: V19728).
// Se houver dígitos a mais no final (ex.: V197289), corta para o formato correto.

// Edite/adicione aqui possíveis nomes de campos que contêm o código:
const FIELD_CANDIDATES = [
  'CÓDIGO CRACHÁ',
  'CÓDIGO CRACHA',
  'codigo_cracha',
  'codigoCracha',
  'codigo-cracha',
  'codigo',
  'Código',
  'CODIGO',
];

function fixCode(input) {
  if (input == null) return input;
  const s = String(input).toUpperCase().trim();

  // Já está correto: 1 letra + 5 dígitos
  if (/^[A-Z]\d{5}$/.test(s)) return s;

  // Tem dígitos a mais no final: pega só a parte correta
  const m = s.match(/^([A-Z])(\d{5})\d+$/);
  if (m) return m[1] + m[2];

  // Não bate com o padrão esperado — devolve como veio
  return s;
}

return items.map(item => {
  const data = { ...item.json };

  // 1) Tenta pelos campos candidatos
  let fieldKey = FIELD_CANDIDATES.find(k => Object.prototype.hasOwnProperty.call(data, k));

  // 2) Se não achar, tenta auto-detectar algum campo string que pareça um código com dígitos extras
  if (!fieldKey) {
    fieldKey = Object.keys(data).find(k => {
      const v = data[k];
      return typeof v === 'string' && /^[A-Za-z]\d{6,}$/.test(v.replace(/\s+/g, ''));
    });
  }

  if (fieldKey) {
    const original = data[fieldKey];
    const corrected = fixCode(original);

    if (corrected !== original) {
      data[fieldKey] = corrected;          // sobrescreve com o valor corrigido
      data.codigo_original = original;     // guarda o original para auditoria
      data.campo_corrigido = fieldKey;     // informa qual campo foi corrigido
      data.status_correcao = 'ajustado';
    } else {
      data.status_correcao = 'ok';
    }
  } else {
    // nenhum campo candidato encontrado neste item
    data.status_correcao = 'sem_campo_detectado';
  }

  return { json: data };
});

